import styled from 'styled-components';

const OptionsTitle = styled.div`
  padding: 0.7rem 1rem;
  font-size: 1.2rem;
  font-weight: bold;
  line-height: 2.1rem;
  text-transform: uppercase;
  color: #9ea7b8;
`;

export default OptionsTitle;
